// import { BrowserRouter, Route } from "react-router-dom";
import Pregunta from "./Pregunta";

const Preguntas = ({ global, setGlobal }) => {
	const cambios = () => {
		// console.log("Soy cambios");
		setGlobal({ [global[0].estado]: true });
	};

	// console.log("Soy global desde Preguntas", global[0]);
	if (global[0].estado === true) {
		return (
			<Pregunta cambios={cambios} setGlobal={setGlobal} global={global} posicion={1}></Pregunta>
		);
	} else {
		return (
			<Pregunta cambios={cambios} setGlobal={setGlobal} global={global} posicion={2}></Pregunta>
		);
	}
};

export default Preguntas;
